    value: 'This filind amends the Mid-Year Report (01/01/01 - 06/31/01).  Amendments
      being filed are as follows: (1) Report is being filed on election cycle-to-date
      figures for all aggregate amounts. (2) Contribution on 6/22/01 in the amount
      of $1000 was incorrectly attributed to The Amalgamated Sugar Company PAC.  Please
      note the Itemized deduction and that this amount is now correctly attributed
      to the Amalgamated Transit Union for $1000.  (3) Contribution on 6/25/01 in
      the amount of $1000 was incorrectly attributed to Florida Sugar Cane League
      PAC in the amount of $1000.  Please note the Itemized deduction .  This amount
      has now been correctly attributed to the Sugar Cane Growers Cooperative of Florida
      (PAC). (4) Due to late notification'
  - value: ' the following In-Kind Contributions of $100.00 and $900.00 from UPSPAC
      have now been accounted for on 5/17/01 in this report.'
